- input: "TEXT\x1CC00370221\x1C.TEXT\x1C\x1CF3XA\x1COn 7/31/08 there is an amount
    of donations recorded for small anonymous donors of $4,488.81. This is partially
    backed out on 12/31/08 in the amount of -$2,211.42. We believe that these amounts
    were caused by two factors. One is small donations that we took in at our convention
    that were under the itemization reporting limit. FEC compliance regarding collection
    of information for donors over the limit and best efforts to obtain the information
    was used at the event. The other is small internet donations that have timing
    differences due to our internet banking system which causes timing differences
    in the accounting system. Usually these amounts are small and immaterial."
